	$(document).ready(function() {			
				
		
		//Custom form elements
		$("select, input[type='checkbox']").uniform();

		//waterwheelCarousel
		$("#waterwheel-carousel-higharch").waterwheelCarousel({
			startingItem: 9,
            startingWaveSeparation: -15,
            waveSeparationFactor: .7,
            centerOffset: 10,
            startingItemSeparation: 160,
           	itemSeparationFactor: .9,
            itemDecreaseFactor: .83, /*отвечает за размер второстепенной картинки*/
			opacityDecreaseFactor: 1,
			movedToCenter: function(){
				var i = $(".active").attr("alt");
				var b = $(".active").parent().attr("href");
		
				$(".name-sport a").html("<span>"+i+"</span>").attr({
					href: b
				});
			}
        });
		

		// Fade in images so there isn't a color "pop" document load and then on window load
			$(".hotel-img img").animate({opacity:1},500);
			
			// clone image
			$('.hotel-img img').each(function(){
				var el = $(this);
				el.css({"position":"absolute"}).wrap("<div class='img_wrapper' style='display: inline-block'>").clone().addClass('img_grayscale').css({"position":"absolute","z-index":"998","opacity":"0"}).insertBefore(el).queue(function(){
					var el = $(this);
					el.parent().css({"width":this.width,"height":this.height});
					el.dequeue();
				});
				this.src = grayscale(this.src);
			});
			
			// Fade image 
			$('.onene-hotel').mouseover(function(){
				$(this).find(".hotel-img .img_wrapper").find('img:first').stop().animate({opacity:1}, 1000);
			})
			$('.onene-hotel').mouseout(function(){
				$(this).find(".img_grayscale").stop().animate({opacity:0}, 1000);
			});
			

			$('.one-block-rating').mouseover(function(){
				$(this).find(".hotel-img .img_wrapper").find('img:first').stop().animate({opacity:1}, 1000);
			})
			$('.one-block-rating').mouseout(function(){
				$(this).find(".img_grayscale").stop().animate({opacity:0}, 1000);
			});				
		
			// Grayscale w canvas method
			function grayscale(src){
				var canvas = document.createElement('canvas');
				var ctx = canvas.getContext('2d');
				var imgObj = new Image();
				imgObj.src = src;
				canvas.width = imgObj.width;
				canvas.height = imgObj.height; 
				ctx.drawImage(imgObj, 0, 0); 
				var imgPixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
				for(var y = 0; y < imgPixels.height; y++){
					for(var x = 0; x < imgPixels.width; x++){
						var i = (y * 4) * imgPixels.width + x * 4;
						var avg = (imgPixels.data[i] + imgPixels.data[i + 1] + imgPixels.data[i + 2]) / 3;
						imgPixels.data[i] = avg; 
						imgPixels.data[i + 1] = avg; 
						imgPixels.data[i + 2] = avg;
					}
				}
				ctx.putImageData(imgPixels, 0, 0, 0, 0, imgPixels.width, imgPixels.height);
				return canvas.toDataURL();
			}
			
						
			//datepicker			
			$('#datepicker, #datepicker').Zebra_DatePicker({
				//direction: 1    // boolean true would've made the date picker future only
								// but starting from today, rather than tomorrow
				months: ['Январь', 'Февраль', 'Март', 'Апрель', 'Май', 'Июнь', 'Июль', 'Август', 'Сентябрь', 'Октябрь', 'Ноябырь', 'Декабрь'],
				days:    ['Понедельник', 'Вторник', 'Среда', 'Четверг', 'Пятница', 'Суббота', 'Воскресенье'],
				first_day_of_week : 7,
				onChange: function(view, elements){
					$(".dp_selected").wrapInner("<span></span>");
				}
			});
			
			$(".dp_previous, .dp_next").html("<span></span>")
			
			
	  
		//photogellery
		$(".preview-img ul li a").click(function(){
			var href = $(this).attr("href");			
			$(".view-img img").attr({
				src: href
			});
			return false;
		});	
		
		// Popup
		$("a.click-popap").fancybox({
			'titlePosition'		: 'outside',
			'overlayColor'		: '#000',
			'overlayOpacity'	: 0.9
		});
		
						
	});
	

	
		
